585/">隔壁惊魂</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E5%B7%A6%E9%A3%9E------------/" target="_blank">李左飞</a>&nbsp;<a href="/s/-%E6%9B%B9%E5%AD%90%E8%BE%B0------------/" target="_blank">曹子辰</a>&nbsp;<a href="/s/-%E7%9F%B3%E9%9B%A8%E6%99%B4------------/" target="_blank">石雨晴</a>&nbsp;<a href="/s/-%E9%99%88%E6%96%87%E5%80%A9------------/" target="_blank">陈文倩</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E9%82%A2%E5%8D%9A--------/" target="_blank">邢博</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/10/" target="_blank">恐怖片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2016/" target="_blank">2016</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>顾蕾（陈文倩 饰）和彭苏（曹子辰 饰）是一对交往已久的恋人，彼此之间感情十分要好某日，两人来到了蓝湖小区，在这里租下了一套房子，在此地建筑两人共同的爱巢。一次偶然中，彭苏结识了住在隔壁的周雅雅（石雨晴 饰），周雅雅开朗乐观又健谈，给彭苏带来了如同春风拂面一般清新的感觉，两人之间竟然有一种相见恨晚的感</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/29585/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/58991/" data-original="http://cj.subo8988.com:8988/upload